import React from "react";



function ActionLink() {
	function handleClick(e) {
		e.preventDefault();
		console.log('По ссылке кликнули.');
	}
}

const Form = props => (
	<form onSubmit={props.getWeather}>
		<input type="text" name="city" placeholder="City..."/>
		<button>Получить погоду</button>
	</form>
);

export default Form;
